import { useState } from "react";
import { Route, Routes, useNavigate } from "react-router-dom";
import { Box, Button, Typography } from "@mui/material";
import OrderHeader from "../components/OrderHeader";

import OrderListFirst from "../components/OrderListFirst";
import OrderListSecond from "../components/OrderListSecond";
import BaseBox from "../components/BaseBox";

const Order = () => {
  const [pageNumber, setPageNumber] = useState(1);
  const navigate = useNavigate();
  return (
    <BaseBox>
      <Box
        display="flex"
        alignItems="center"
        justifyContent="center"
        width="100%"
        bgcolor="primary.main"
        pb={3}
        sx={{
          boxSizing: "border-box",
        }}
      >
        <OrderHeader pageNumber={pageNumber} />
      </Box>
      <Button
        onClick={() => {
          setPageNumber(pageNumber < 3 ? pageNumber + 1 : 1);
        }}
      >
        change state
      </Button>
      {pageNumber === 1 && <OrderListFirst />}
      {pageNumber === 2 && <OrderListSecond />}
      {pageNumber === 3 && navigate("/OrderResult")}
    </BaseBox>
  );
};

export default Order;
